import React, { Component, Fragment } from "react";
import { Route, Switch } from "react-router-dom";
import ProductDetail from "./../../Components/ProductDetail/ProductDetail";
import Header from "./../../Components/LoginPage/HeaderLogin/Header/Header";
// import Breadcumb from "./../../Components/LoginPage/ContentLogin/Breadcumb/Breadcumb";
import Footer from "./../../Components/HomePage/Footer/Footer";
import Specification from "../../Components/ProductDetail/Specification/Specification";

class DetailPage extends Component {
  render() {
    return (
      <Fragment>
        <Header />
        {/* <Breadcumb
          to="/"
          toBack="Home"
          to1="/GraphicsCard"
          toBack1="Graphics Cards"
          current="AORUS GeForce RTXâ„¢ 3090 XTREME WATERFORCE 24G"
          bgr="bgr-black"
        /> */}
        {this.showRoute(routes)}
        <Footer />
      </Fragment>
    );
  }

  showRoute = (list) => {
    var result = null;
    console.log(list);
    if (list.length > 0) {
      result = list.map((item, index) => {
        return (
          <Route
            key={index}
            path={item.path}
            exact={item.exact}
            component={item.main}
          />
        );
      });
    }
    return <Switch>result</Switch>;
  };
}

const routes = [
  {
    path: "/product",
    exact: true,
    main: () => <ProductDetail />,
  },
  {
    path: "/product/Specification",
    exact: false,
    main: () => <Specification />,
  },
];

export default DetailPage;
